import React from "react";
import ReactDOM from "react-dom";

//components can take inputs in the form of props (or properties).
function WelcomeMessage(props)
{
  const name = props.name;
  const greeting = props.greeting;
  return <p>{greeting}, {name}! </p>;
}

//pascal case
//a (finctional) component is just a js function that returns jsx
function App() {
  return (
    <main>
      <h1>Henloooo</h1>
      <p>My first react app!</p>
      <h2>Welcome</h2>
      <WelcomeMessage name="jo" greeting="Hello buddy!"/>
      <WelcomeMessage name="jose" greeting="sup bro"/>
      <WelcomeMessage name="person" greeting="Welcome"/>
      <h2>Buttons</h2>
      {/* TODO */}
      <h2>Chat</h2>
      {/* TODO */}
    </main>
  );
}

ReactDOM.render(
  <React.StrictMode>
    <App></App>
  </React.StrictMode>,
  document.querySelector("#root")
);
